are:PredmetCinnosti.are:Text:
Činnost za účelem zajišťování potřeb svých členů spočívající především v:
a) organizování přípravy a provádění popř. zabezpečování výstavby bytů, rodinných domů a nebytových prostor;
b) provádění popř. zajišťování správy, údržby, oprav, modernizací a rekonstrukcí bytových a nebytových objektů, bytů a nebytových prostor ve vlastnictví družstva nebo členů družstva;
c) zajišťování plnění spojených s užíváním bytů a nebytových prostor ve vlastnictví družstva nebo členů družstva;
d) uzavírání smluv o nájmu družstevních bytů (družstevních nebytových prostor), popř. jiných smluv souvisejících s jejich užíváním
